OS X Mavericks 10.9.1 Build 13B40


Pre Release version of OS X Mavericks 10.9.1 Build 13B40

The update 10.9.1 improves the stability  and compatibility of your Mac,and is recommended

for all OS X Mavericks users.

This update includes the following fixes:



-Improves support for GMail in OS X Mail,and fixes for users with custom GMail seetings;

-Improves the reability of Smart Mailboxes and search in Mail;

-Fixes an isue that prevent contract groups from working propely in Mail;

-Resolves an isue that prevent VoiceOver from speaking sentences that contain emoji;

-Updates shared links periodically when open in the Safari side bar.
